import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const Register = () => {
  const [formData, setFormData] = useState({
    username: '',
    password: '',
    email: '',
    companyName: '',
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleRegister = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');
    setIsLoading(true);

    try {
      const res = await fetch('http://localhost:3000/api/auth/register', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData)
      });

      const data = await res.json();

      if (!res.ok) {
        throw new Error(data.error || 'Inscription échouée');
      }

      setSuccess('✅ Inscription réussie ! Redirection en cours...');
      setTimeout(() => navigate('/'), 2000);
      
    } catch (err) {
      setError(err.message || 'Erreur de connexion au serveur');
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="flex items-center justify-center min-h-screen bg-sky-500 p-4">
      <form
        onSubmit={handleRegister}
        className="bg-white p-6 rounded-xl shadow-lg w-full max-w-md"
      >
        <h2 className="text-3xl font-semibold mb-6 text-center text-sky-600">
          Créer un compte entreprise
        </h2>

        {error && (
          <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4 text-sm">
            {error}
          </div>
        )}

        {success && (
          <div className="bg-green-100 border border-green-400 text-green-700 px-4 py-3 rounded mb-4 text-sm">
            {success}
          </div>
        )}

        <div className="mb-4">
          <label className="block text-sm font-medium mb-1 text-gray-700">Nom d'utilisateur</label>
          <input
            name="username"
            onChange={handleChange}
            required
            placeholder="Ex: entrepriseX"
            className="w-full p-2 rounded bg-gray-50 border border-gray-300 focus:outline-none focus:ring-1 focus:ring-sky-400 text-sm"
          />
        </div>

        <div className="mb-4">
          <label className="block text-sm font-medium mb-1 text-gray-700">Email</label>
          <input
            name="email"
            type="email"
            onChange={handleChange}
            required
            placeholder="exemple@mail.com"
            className="w-full p-2 rounded bg-gray-50 border border-gray-300 focus:outline-none focus:ring-1 focus:ring-sky-400 text-sm"
          />
        </div>

        <div className="mb-4">
          <label className="block text-sm font-medium mb-1 text-gray-700">Nom de l'entreprise</label>
          <input
            name="companyName"
            onChange={handleChange}
            placeholder="Entreprise S.A."
            className="w-full p-2 rounded bg-gray-50 border border-gray-300 focus:outline-none focus:ring-1 focus:ring-sky-400 text-sm"
          />
        </div>

        <div className="mb-6">
          <label className="block text-sm font-medium mb-1 text-gray-700">Mot de passe</label>
          <input
            name="password"
            type="password"
            onChange={handleChange}
            required
            placeholder="******"
            className="w-full p-2 rounded bg-gray-50 border border-gray-300 focus:outline-none focus:ring-1 focus:ring-sky-400 text-sm"
          />
        </div>

        <button
          type="submit"
          disabled={isLoading}
          className={`w-full bg-sky-600 hover:bg-sky-700 text-white font-medium py-2 px-4 rounded transition duration-300 flex items-center justify-center ${isLoading ? 'opacity-75 cursor-not-allowed' : ''}`}
        >
          {isLoading ? (
            <>
              <svg className="animate-spin -ml-1 mr-3 h-5 w-5 text-white" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
                <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
                <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
              </svg>
              Inscription...
            </>
          ) : "S'inscrire"}
        </button>

        <div className="text-center mt-4 text-sm">
          <p className="text-gray-600">
            Déjà un compte ?{' '}
            <a 
              href="/login" 
              className="text-sky-600 hover:text-sky-800 underline transition duration-200"
            >
              Se connecter
            </a>
          </p>
        </div>
      </form>
    </div>
  );
};

export default Register;
